import React from 'react';

export default class Title extends React.Component{
    render(){
      return(
        <div>
         <p> Нурминский</p>
         <p> тут </p>
         <p> должен</p>
         <p> быть</p>
         <p> музыка</p>
        </div>
      )
    }
  }
